import react, { useState } from 'react';
import Button from './Button';
import styles from './App.module.css';

function App() {
    const [counter, setValue] = useState();
    const onClick = () => setValue((prev) => prev + 1);
    return (
        <div className="App">
            <h1>{counter}</h1>
            <Button onClick={onClick} text={'Continue'} />
        </div>
    );
}

export default App;
